import React from 'react';
import IconeSearch from './img/iconeSearch.png'

class LogoTipo extends React.Component{
  render(){
    return(
      <div>
       <img src={IconeSearch} alt="search"/>
      </div>
    );
  }
}
export default LogoTipo
